DROP TABLE IF EXISTS `adresse`;
CREATE TABLE `adresse` (
  `ID_ADRESSE` bigint(20) NOT NULL AUTO_INCREMENT,
  `CP` varchar(255) DEFAULT NULL,
  `LIEU` varchar(255) DEFAULT NULL,
  `VILLE` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`ID_ADRESSE`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8;

INSERT INTO `adresse` VALUES (1,'38000','GRENOBLE','GRENOBLE');

DROP TABLE IF EXISTS `client`;

CREATE TABLE `client` (
  `ID` bigint(20) NOT NULL AUTO_INCREMENT,
  `CLIENT_TYPE` varchar(3) DEFAULT NULL,
  `ADRESSE_ID_ADRESSE` bigint(20) DEFAULT NULL,
  `NOMSOCIETE` varchar(255) DEFAULT NULL,
  `NOM` varchar(255) DEFAULT NULL,
  `PRENOM` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`ID`),
  KEY `FK_CLIENT_ADRESSE_ID_ADRESSE` (`ADRESSE_ID_ADRESSE`),
  CONSTRAINT `FK_CLIENT_ADRESSE_ID_ADRESSE` FOREIGN KEY (`ADRESSE_ID_ADRESSE`) REFERENCES `adresse` (`ID_ADRESSE`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8;

