DROP TABLE IF EXISTS `facture`;

CREATE TABLE `facture` (
  `ID_FACTURE` bigint(20) NOT NULL AUTO_INCREMENT,
  `FACTURE_TYPE` varchar(3) DEFAULT NULL,
  `DATE_FACTURATION` varchar(255) DEFAULT NULL,
  `DATE_LIVRAISON` varchar(255) DEFAULT NULL,
  `IMMATRICULATION` varchar(255) DEFAULT NULL,
  `MODE_PAYEMENT` varchar(255) DEFAULT NULL,
  `ID_CLIENT` bigint(20) DEFAULT NULL,
  PRIMARY KEY (`ID_FACTURE`),
  KEY `FK_FACTURE_ID_CLIENT` (`ID_CLIENT`),
  CONSTRAINT `FK_FACTURE_ID_CLIENT` FOREIGN KEY (`ID_CLIENT`) REFERENCES `client` (`ID`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8;

