  `QUANTITE` int(11) DEFAULT '0',
  `RABAIS` decimal(5,2) DEFAULT '0.00',
  `REMISE` decimal(5,2) DEFAULT '0.00',
  `RISTOURNE` decimal(5,2) DEFAULT '0.00',
  `ID_FACTURE` bigint(20) DEFAULT NULL,
  `ID_PIECE` bigint(20) DEFAULT NULL,
  PRIMARY KEY (`ID_LIGNE`),
  KEY `FK_LIGNE_ID_FACTURE` (`ID_FACTURE`),
  KEY `FK_LIGNE_ID_PIECE` (`ID_PIECE`)
  
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8;

